        `},"home-automation":{title:n("projects.personalProjects.homeAutomation.title"),description:n("projects.personalProjects.homeAutomation.description"),technologies:n("projects.personalProjects.homeAutomation.tech"),category:"personal",period:"2024 - En cours",location:"Domicile",image:"https://images.pexels.com/photos/1571460/pexels-photo-1571460.jpeg?auto=compress&cs=tinysrgb&w=1200",gitlabUrl:"https://gitlab.com/samuel.lecomte37/home-assistant-config",detailedDescription:`
